import React, { useState } from 'react';
import { CountdownCircleTimer } from 'react-countdown-circle-timer'


const App = () => {

    return (
    <>
    
  
  <CountdownCircleTimer
    isPlaying
    duration={10}
    colors={[
      ['#004777', 0.33],
      ['#F7B801', 0.33],
      ['#A30000', 0.33],
    ]}
  >
    {({ remainingTime }) => remainingTime}
  </CountdownCircleTimer>

    </>

);

}



export default App;
